// core components/views
import TransferIntraAgency from "views/User/Transfer/TransferIntraAgency.jsx";
import Transfer from "views/User/Transfer/TransferPage.jsx";
import TransfersTable from "views/User/Transfer/TransfersTable.jsx";
import TransfersTableCTN from "views/User/Transfer/TransfersTableCTN.jsx";

const dashboardRoutesUser = [
  {
     path: "/addtransfer",
     name: "Virement",
     icon: "fa fa-retweet",
     component: TransferIntraAgency,
     layout: "/user"
  },
  {
     path: "/transfers/:id",
     name: "Virement",
     icon: "fa fa-retweet",
     component: Transfer,
     layout: "/user",
      sub: true
  },
  {
     path: "/transfers",
     name: "Tableau des virements",
     icon: "tim-icons icon-bell-55",
     component: TransfersTable,
     layout: "/user"
  },
    {
        path: "/ctrltransfers",
        name: "Tableau des virements",
        icon: "tim-icons icon-bell-55",
        component: TransfersTableCTN,
        layout: "/user"
    },
  { redirect: true, path: "/", to: "/", navbarName: "Redirect" }
];

export default dashboardRoutesUser;
